          "label": "   draw: function() {\n\n      var horizontalPeriodStrokeColor = \"black\";\n      var horizontalPeriodStrokeWidth = 1;\n\n\t\t\tif (typeof this.style != 'undefined' && \n\t\t\t\t\tthis.style != null && \n\t\t\t\t\tthis.style.length > 0 && \n\t\t\t\t\tthis.bldr.conf.timelineStyles[this.style] != null) {\n\t\t\t\tvar stl = this.bldr.conf.timelineStyles[this.style];\n\t\t\t\tif (typeof stl.strokeWidth != 'undefined' && \n\t\t\t\t\t\tstl.strokeWidth != null && \n\t\t\t\t\t\tstl.strokeWidth.length > 0 ) {\n\t\t\t\t\thorizontalPeriodStrokeWidth = parseInt(stl.strokeWidth);\n\t\t\t\t}\n\t\t\t\tif (typeof stl.strokeColor != 'undefined' && \n\t\t\t\t\t\tstl.strokeColor != null && \n\t\t\t\t\t\tstl.strokeColor.length > 0 ) {\n\t\t\t\t\tvar c = stl.strokeColor.split(\",\");\n\t\t\t\t\tvar red = parseInt(c[0]);\n\t\t\t\t\tvar green = parseInt(c[1]);\n\t\t\t\t\tvar blue = parseInt(c[2]);\n\t\t\t\t\thorizontalPeriodStrokeColor = \"rgba(\"+red+\",\"+green+\",\"+blue+\",255)\";\n\t\t\t\t}\n\t\t\t}\n\n         var periodStartPositionData = this.bldr.timelineDatePosition(this.startDate);\n         var periodEndPositionData = this.bldr.timelineDatePosition(this.endDate);\n\n         var periodNodeXStartPosition = this.bldr.scale.scalePositionX + \n            periodStartPositionData.dateXPositionInPixels;\n         var periodNodeXEndPosition = this.bldr.scale.scalePositionX + periodEndPositionData.dateXPositionInPixels;\n         var periodNodeYPosition = this.bldr.scale.scalePositionY - \n            (this.bldr.conf.artboardHeightPixels*this.height/100) - 100;\n\n                var periodNodeId = network.body.data.nodes.add([{\n                   label: prepareCaption(this.caption),\n                   x:periodNodeXStartPosition,\n                   y:periodNodeYPosition\n                }])[0];\n\n                var periodNode = network.body.nodes[periodNodeId];\n                network.nodesHandler.moveNode(periodNodeId, \n                   periodNode.x + periodNode.shape.width/2 - 1, \n                   periodNode.y - periodNode.shape.height/2);\n\n                var periodDateNodeId = network.body.data.nodes.add([{\n                   label: this.startDate + \" — \" + this.endDate,\n                   x:periodNodeXStartPosition,\n                   y:periodNodeYPosition + 24,\n                   color: {background: \"rgba(0,0,0,0)\"},\n                   font:{size:10}\n                }])[0];\n\n                var periodDateNode = network.body.nodes[periodDateNodeId];\n                network.nodesHandler.moveNode(periodDateNodeId, \n                   periodDateNode.x + periodDateNode.shape.width/2 - 1, \n                   periodDateNode.y - periodDateNode.shape.height/2);\n\n                var periodLeftLegBottomNodeId = network.body.data.nodes.add([{\n                   label: \"\",\n                   x:periodNodeXStartPosition,\n                   y:this.bldr.scale.scalePositionY - 75,\n                   margin:{top: 1, right: 1, bottom: 1, left: 1},\n                   font:{size:5},\n                   color: {background: \"rgba(0,0,0,0)\"}\n                }])[0];\n\n                var periodLeftLegTopNodeId = network.body.data.nodes.add([{\n                   label: \"\",\n                   x:periodNodeXStartPosition,\n                   y:periodNodeYPosition,\n                   margin:{top: 1, right: 1, bottom: 1, left: 1},\n                   font:{size:5},\n                   color: {background: \"rgba(0,0,0,0)\"}\n                }])[0];\n\n                network.body.data.edges.add({\n                   from:periodLeftLegBottomNodeId,\n                   to:periodLeftLegTopNodeId\n                });\n\n                var periodRightLegBottomNodeId = network.body.data.nodes.add([{\n                   label: \"\",\n                   x:periodNodeXEndPosition,\n                   y:this.bldr.scale.scalePositionY - 75,\n                   margin:{top: 1, right: 1, bottom: 1, left: 1},\n                   font:{size:5},\n                   color: {background: \"rgba(0,0,0,0)\"}\n                }])[0];\n\n                var periodRightLegTopNodeId = network.body.data.nodes.add([{\n                   label: \"\",\n                   x:periodNodeXEndPosition,\n                   y:periodNodeYPosition,\n                   margin:{top: 1, right: 1, bottom: 1, left: 1},\n                   font:{size:5},\n                   color: {background: \"rgba(0,0,0,0)\"}\n                }])[0];\n\n                network.body.data.edges.add({\n                   from:periodLeftLegTopNodeId,\n                   to:periodRightLegTopNodeId,\n                   color: horizontalPeriodStrokeColor,\n                   width: horizontalPeriodStrokeWidth\n                });\n\n                network.body.data.edges.add({\n                   from:periodRightLegTopNodeId,\n                   to:periodRightLegBottomNodeId\n                });\n      }\n   };\n}",
